import React, { useState, useEffect } from "react";
import Bird from "./Bird";
import Empty from "./Empty";

function ObjectCreatorBird({ objectIndex, onCollision }) {
    const [isPaused, setIsPaused] = useState(false);

    useEffect(() => {
        if (objectIndex >= 0 && objectIndex <= 500) {
            setIsPaused(true);
            setTimeout(() => {
                setIsPaused(false);
            }, 10000);
            onCollision();
        }
    }, [objectIndex, onCollision]);

    return isPaused ? <Empty /> : <Bird />;
}

export default ObjectCreatorBird;
